import React from 'react';
import './posts.css'
const Articles = (props) => {
    return(
        <div className="post">
            <h3>{props.author}</h3>
            <h3>{props.title}</h3>
            <h6>{props.content}</h6>
        </div>
    )
}
export default Articles;
